import { container, title } from "../../material-kit-react.js";

const pillsStyle = {
  section: {
    padding: "50px 0 100px 0px"
  },
  container,
  title: {
    ...title,
    marginLeft: "20px",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none"
  }
};

export default pillsStyle;
